  </div>
</template>

<script>
export default {
  data() {
    return {
      email: '',
      password: '',
    };
  },
  methods: {
    loginUser() {
      // Perform login operation (will connect with backend later)
      console.log('User logged in with', this.email, this.password);
    }
  }
};
</script>
